function EventDetailPage() {
  return (
    <>
     <EventsList/>
    </>
  );
}

export default EventDetailPage;

export async function loader(){
    const data  = fetch("http://localhost:3000/events");
    const response = await data;

    if(!response.ok){
      json({message: 'Could not fetch the data'},{status:500});
    }
}
